import axios from "axios"
import { transapi,header } from "../constant"

const Transfer = async (body)=>{

    let data=null;
    body && body.map(item => {
      data[item.id]=item;  
    })
    console.log(data)
    const response  = await axios({
        method:"POST",
        url:transapi,
        data:data,
        headers:header

    })
    return response;
}

export default Transfer;
